import React from 'react';
import woman from './../../assets/woman.jpg'
import men from './../../assets/men.jpg'

const Directory = props => {
    return (
        <div>
            <div
                className="item"
                style={{
                    backgroundImage: `url(${woman})`
                }}
            >

            </div>
            <div>
                style={{
                    backgroundImage: `url(${men})`
                }}
            </div>
        </div>
    );
}

export default Directory;
